import { useState, useRef } from "react";
import emailjs from '@emailjs/browser';
import carl from '../../cat.svg'
import HK_GIF from './../../Photos/hello_kitty.gif'
import Typing from "./typing";

function HelloKitty(){
    const [convo, setConvo] = useState('Lets start easy! Which day is our anniversary?');
    const correct_answer = () => {
        alert("CORRECCT");
      }


    return (
        <div className='bg-HKitty-Pink  w-full h-screen flex justify-center items-center flex-col'>

           <div className="">
                {/* avatar and dialouge*/}
                <div className="w-[170px] left-0 relative">
                    <div className=" w-2 h-2 rounded-full bg-HKWHITE absolute right-[20px] top-[20px] "></div>
                    <div className=" w-3 h-3 rounded-full bg-HKWHITE absolute right-0 top-0 "></div>
                    <div className=" w-4 h-4 rounded-full bg-HKWHITE absolute right-[-20px] top-[-20px] "></div>

                    <div className=" w-[170px] h-[100px] rounded-lg bg-HKWHITE absolute right-[-190px] top-[-120px] ">
                        <div className="p-2 text-xl"><Typing speed={100} msg={convo} /></div>
                        
                    </div>
                    
                    <img className='w-[170px] h-[170px] rounded-full ' src={HK_GIF} />
                </div>
                
                {/* Below is the answer box*/}
                <div className="bg-[#fbcfe8] w-[800px] h-[400px] rounded-lg place-content-center text-2xl">

                    <div className="h-1/2 flex justify-center rounded-lg p-3 ">
                        <div className="border-2 w-1/2 m-3 rounded-lg bg-HKWHITE flex justify-center items-center hover:opacity-70" onClick={correct_answer}>This is answer 1</div>
                        <div className="border-2 w-1/2 m-3 rounded-lg bg-HKWHITE flex justify-center items-center hover:opacity-70">This is answer 2</div>
                    </div>
                    <div className="h-1/2 flex justify-center p-3">
                        <div className="border-2 w-1/2 m-3 rounded-lg bg-HKWHITE flex justify-center items-center hover:opacity-70">This is answer 3</div>
                        <div className="border-2 w-1/2 m-3 rounded-lg bg-HKWHITE flex justify-center items-center hover:opacity-70">This is answer 4</div>
                    </div>
                </div>
           </div>
            

        </div>
    )

}
export default HelloKitty;
